import '../App.css';
import Header from "../header/Header";
import { GoogleMap, withScriptjs, withGoogleMap } from 'google-maps-react';

function map() {
  return (
    <GoogleMap 
      defaultZoom={10}
      defaultCenter={{ lat: 45.420422, lng: -75.692429 }}
    />
  );
}

const WrappedMap = withScriptjs()

const Dashboard = () => {
  return (
    <>
      <Header />
    </>
  );
}

export default Dashboard;
